import React from 'react'
import { BrowserRouter as Router, Route, NavLink, Routes } from 'react-router-dom';

const style = {
    marginRight: 10,
    color: 'black'
};
class Main extends React.Component {
    render() {
        return (
            <div>
                <nav className="navbar navbar-expand-lg navbar-light bg-primary">
                    <i className="navbar-brand pl-2">KBS INVENTORY</i>
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                        <div className="navbar-nav">
                            <button className="nav-item nav-link btn btn-warning" style={style}><NavLink to="/profile">Profile</NavLink></button>
                            <button className="nav-item nav-link btn btn-warning"><NavLink to="/list">List of cars</NavLink></button>
                        </div>
                    </div>
                </nav>
                <div className="container">
                    <Router>
                        <Routes>
                            <Route exact path="/" element={<Main />}></Route>
                            <Route exact path="/profile" element={<Profile />}></Route>
                            <Route exact path="/list" element={<List />}></Route>
                        </Routes>
                    </Router>
                </div>
            </div>
        )
    }
}
export default Main;
